    [],nt"revision_timestamp": "2013-03-15T20:56:10.758178",nt"name": "gulf-coastal-vulnerability-to-sea-level-rise-u-s-gulf-coast",nt"isopen":
    false,nt"url": null,nt"notes": "The goal of this project is to quantify,
    at the National scale, the relative susceptibility of the Nation's coast to sea-level
    rise through the use of a coastal vulnerability index (CVI). This initial classification
    is based upon the variables geomorphology, regional coastal slope, tide range, wave
    height, relative sea-level rise and shoreline erosion and accretion rates. The combination
    of these variables and the association of these variables to each other furnish
    a broad overview of regions where physical changes are likely to occur due to sea-level
    rise.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
